  false,\n\t\"url\": null,\n\t\"notes\": \"Hydrographic data were collected in Pescadero
  Basin (at the entrance to the Gulf of California) and subsequently along the West
  Coast of Baja California and Southern and Central California on R/V Point Sur from
  19 April to 2 May 2013. Objectives of data collection were to measure both the exchange
  of waters between the Pacific Ocean and Gulf of California and the variation of
  water properties in the California Undercurrent as it transported water along the
  1000 m isobaths to the north. The purpose of this report is to provide summary listings
  of cruise data, a description of data collection and processing procedures, and
  a brief report of oceanographic conditions. Data collection included profiles of
  conductivity, temperature, dissolved oxygen, nutrients and ocean currents at fixed
  stations as well as underway observations of sea surface and atmospheric properties
  and ocean currents. In contrast to previous observations of cyclonic flow, a well-defined
  pattern of anticyclonic flow of upper waters was observed in Pescadero Basin with
  flow into the Gulf along Baja California and flow into the Pacific along Sinaloa.\",\n\t\"owner_org\":
